import React from "react";

const FolderOptions = () => {
   return (  
      <div className="folder-option-headers text-font-14px">
         <p className='folder-options bg-color-gray'>File</p>
         <p className='folder-options'>Home</p>
         <p className='folder-options'>Share</p>
         <p className='folder-options'>View</p>
      </div>
   );
}
 
export default FolderOptions;
